import React from "react";
import Highcharts from 'highcharts';
import HighchartsReact from "highcharts-react-official";
import drilldown from "highcharts/modules/drilldown"
import mlData from '../allData/mlData';

drilldown(Highcharts);

function DrillDownPie() {

  function componentDidMount() {
    // load modules
    drilldown(Highcharts);
  }
  let options = {
    chart:
    {
      type: 'pie',
      backgroundColor:'transparent',
      height:'300px'
    },
    title: 
    {
      style:{color:'white',fontSize:'15px',fontFamily:'cursive'},
      text: '(Click on each section for more info)'
      
    },
    series: [
      {
        name:'Top',
        colorByPoint:true,
        data: mlData.mainData,
        drilldown: {
          series: mlData.drillData
        }
      }
    ],
    credits: {
      enabled:false
    }
  }


  return (
    <span>
      <HighchartsReact 
        highcharts={Highcharts}
        options={options}
      />
    </span>
  )
}

export default DrillDownPie;
